Estimado usuario, para un mejor uso del robot, te recomendamos que realice un mantenimiento regular del robot. 
1. Rueda auxiliar y rueda motriz: limpia a tiempo los cuerpos extraños tales como los pelos enredados con la rueda auxiliar y el rueda motriz, y los objetos transportados por la rueda motriz. Revisa y limpia al menos una vez a la semana; 
2. Cámara del sensor: limpia a tiempo la lente de la cámara superior y la cámara del sensor de visión estereoscópica para la evitación de obstáculos. Limpia con un paño de algodón suave. Revisa y límpa al menos una vez a la semana. En caso de suciedad o daño repentino, se debe resolverlo inmediatamente; 
3. Cuerpo de la máquina y bandeja: Mantén limpio el cuerpo de la máquina y ordenada la bandeja. Se recomienda limpiar una vez al día.
